//import style from "./Card.module.css"
import { Link } from "react-router-dom";

const Card = (props) => {
  return (
    <div className="max-w-[270px] max-h-[300px] bg-white border border-gray-200 rounded-lg shadow m-2 justify-center flex-col" >
      <img src={props.flag} alt={props.name} className="rounded-t-lg" />

      <div className="p-3">
        <h5 className="mb-2 text-2xl font-bold tracking-tight text-lime-700"> Name:{props.name} </h5>
        <p className="mb-3 font-normal text-lime-700"> Continents:{props.continents} </p>
        <Link to={`/countries/${props.id}`}>
          <button className="inline-flex items-center px-3 py-2 text-sm font-medium text-center text-white bg-amber-400 rounded-lg hover:bg-lime-200 focus:ring-4 focus:outline-none focus:ring-blue-300"> Details </button>
        </Link>
      </div>
    </div>
  );
};

export default Card;
